var ShipStatMonitor=function(){function n(n){this._myShip=n,this._speedHolder=$("#Speed"),this._healthHolder=$("#IncreasedHealth"),this._damageHolder=$("#IncreasedDamage")}return n.prototype.Update=function(){var n=Math.round(Math.sqrt(Math.pow(this._myShip.MovementController.Velocity.X,2)+Math.pow(this._myShip.MovementController.Velocity.Y,2))),t=this._myShip.MaxLife-Ship.START_LIFE,i=Math.round((this._myShip.Level-1)*Ship.DAMAGE_INCREASE_RATE*10)/10;this._speedHolder.html(n.toString()),this._healthHolder.html(t.toString()),this._damageHolder.html(i.toString())},n}()